import { Link, useNavigate } from "react-router-dom";

const Home = () => {
  const navigate = useNavigate();

  function navigateHandler(){
    navigate('/products')
  }

  return (
    <div>
      <h1>fuck off</h1>
      <Link to="/products">Products</Link>
      <button onClick={navigateHandler}>Navigate</button>
    </div>
  );
};

export default Home;
